@NgModule({
    declarations: [
        AppComponent,
        SomeJpgFilesComponent,
        NoJpgFilesComponent,
        ImgComponent,
        //ListBarComponent ,
        //JpgFilesComponent,
        //HomeComponent

    ],
    providers: [],
    bootstrap: [AppComponent],
    imports: [
        BrowserModule,
        AppRoutingModule,
        BrowserAnimationsModule,
        DatePipe,
        //???
